import Button from "../Button";
import style from "./BtnIcon.module.css";

function BtnIcon(props) {
  return (
    <Button type="button" className={style["btn--icon"]}>
      <div
        onClick={props.onClick}
        data-id={props.id}
        className={style["btn__inner"]}
      ></div>
      <props.icon className={style.icon} />
      <span className={style["btn__text"]}>{props.id}</span>
    </Button>
  );
}

export default BtnIcon;
